import React from 'react'
import { ArrowLeftOutlined, ArrowRightOutlined } from "@material-ui/icons"

const Container = styled.div`
    width: 100%;
    height: 90vh;
    display: flex;
    position: relative;
    overflow: hidden;
`

const Slider = () => {
  return (
    <Container>
        <Arrow>
            <ArrowLeftOutlined/>

        </Arrow>
    </Container>
  )
}

export default Slider
